import Link from 'next/link';
import React, { ReactNode } from 'react';

const UserLink = ({
	className,
	disabled,
	children,
}: {
	className?: string;
	disabled?: boolean;
	children?: ReactNode;
}) => {
	if (disabled) {
		return (
			<a
				className={
					'text-yellow-400 font-medium' + (className ? ` ${className}` : '')
				}
			>
				RiznSun
			</a>
		);
	}

	return (
		<Link href="/users/1">
			{children && children}
			{!children && (
				<a
					className={
						'text-yellow-400 font-medium' + (className ? ` ${className}` : '')
					}
				>
					RiznSun
				</a>
			)}
		</Link>
	);
};

export default UserLink;
